// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.15;



contract Donation1{
    // 수혜자가 수혜 신청을 하면 이 스마트 컨트랙트를 배포하기 위해 수혜자를 지정
    address payable private beneficiary;
    // 수혜를 신청하면 60일동안 기부를 받도록 설정하기 위해 배포날짜를 지정.
    uint public startDate;
    // 기부자의 기부 금액을 볼 수 있다.
    mapping (address=>uint) donationHistory;

    constructor(){
        beneficiary = payable(msg.sender);
        startDate = block.timestamp;
    }

    // 기부자가 수혜자(스마트 컨트랙트)에게 기부하기
    function donateToBeneficiaryContract() public payable {
        require(msg.sender !=beneficiary && block.timestamp < startDate + 60 days,"");
        donationHistory[msg.sender] += msg.value;
        
    }

    // 현재 총 기부금 출력
    function currentTotalDonationValue() public view returns(uint){
        return address(this).balance;
    }

    // 스마트 컨트랙트에서 수혜자로 기부금 전달 하기
    function donateToBeneficiary() private {
        if(block.timestamp > startDate + 60 days)
        beneficiary.transfer(address(this).balance);
    }
    // 내 기부금 조회하기
    function getMyDonationValue(address _addr) public view returns(uint){
        return donationHistory[_addr];
    }
}

